//console.log("Loading Table2DLib.js");

function Table2D() {
    this.Show=function(state,matrix,item,skeys,colkey,colvalues,rowkey,rowvalues,cellMode){
	var step=1
	if (cellMode === state.Show.code.mSeries) {step=Math.max(1,Math.ceil(state,colvalues.length/20));}
	// make header row
	var row = document.createElement("TR");
	//console.log("Col=",colkey," row=",rowkey);
	this.appendHeaderRow2D(state,matrix,row,rowkey,colkey,colvalues,cellMode,step);
	item.appendChild(row);
	// make data rows
	var rlen=rowvalues.length;
	for(var ii=0; ii<rlen; ii++) {
	    var rel = (ii === 0?"first":(state,ii === rlen-1?"last":"middle"));
	    // make "header" column
	    row = document.createElement("TR");
	    this.appendDataRow2D(state,matrix,row,colkey,colvalues,rowkey,rowvalues[ii],rel,cellMode,step);
	    item.appendChild(row);
	}
    };
    this.appendHeaderRow2D=function(state,matrix,row,rowkey,colkey,colvalues,cellMode,step) {
	state.Html.appendRotateElement(state,row,rowkey,colkey); // add rotation-element
	var clen=colvalues.length;
	for(var ii=0; ii<clen; ii=ii+step) {
	    var rel = (ii === 0?"first":(state,ii === clen-1?"last":"middle"));
	    var rotate=(state.Layout.rotate||{})[colkey]||"";
	    var colval = colvalues[ii];
	    var colwhere = "";
	    var cnt=0
	    for (var kk=ii;kk<Math.min(clen,ii+step);kk++) {
		if (colwhere !== "") {colwhere=colwhere + " or ";}
		colwhere=colwhere + state.Database.getWhereDetail(colkey,colvalues[kk]);
		cnt=cnt+1;
	    };
	    // make "header" column
	    row.appendChild(
		state.Html.makeHeaderElement(state,
		    colkey,         // pkey
		    colval||"",         // pval
		    rel,          // prel
		    "col",        // ptyp
		    "state.Layout.selectKey(state,'"+colkey+"','"+(colvalues[ii]||"")+"','"+colwhere+"','"+cnt+"');",
		    colwhere,
		    rotate
		)
	    );
	}
    };
    this.appendDataRow2D=function(state,matrix,row,colkey,colvalues,rowkey,rowval,rel,cellMode,step) {
	var rowwhere=state.Database.getWhereDetail(rowkey,(rowval||""));
	if (rowkey === "") {
	    state.Html.appendEmptyHeader(state,row);// add empty element
	} else {
	    row.appendChild(
		state.Html.makeHeaderElement(state,
		    rowkey,         // pkey
		    rowval||"",     // pval
		    rel,          // prel
		    "row",        // ptyp
		    "state.Layout.selectKey(state,'"+rowkey+"','"+(rowval||"")+"','"+rowwhere+"','1');",
		    rowwhere,
		    "" // never rotate
		));
	};
	var range=state.Matrix.getRange(state,matrix,colvalues,[rowval]);
	var clen=colvalues.length;
	for(var jj=0; jj<clen; jj=jj+step) {
	    var colwhere="";
	    var cnt=0;
	    var elements=undefined
	    for (var kk=jj;kk<jj+step;kk++) {
		var element=state.Matrix.getMatrixElement(colvalues[kk],rowval,matrix);
		if (element  === undefined) {
		} else {
		    //console.log("Found:",colvalues[kk],rowval);
		    if (elements === undefined) {elements=[];};
		    elements.push(element);
		}
		if (colwhere !== "") {colwhere=colwhere + " or ";}
		colwhere=colwhere + state.Database.getWhereDetail(colkey,colvalues[kk]);
		cnt=cnt+1;
	    }
	    //console.log("Matrix:",colvalues[jj],rowval,JSON.stringify(matrix));
	    if (elements  === undefined) {
		state.Html.appendEmptyData(state,row);// add empty element
	    } else if (elements !== undefined) {
		if (cellMode  === state.Show.code.mSum) {
		    row.appendChild(
			state.Html.makeDataElement(state,
			    elements,
			    "state.Layout.selectItem(state,'"+colkey+"','"+rowkey+"','"+colvalues[jj]+"','"+rowval+"','"+
				colwhere+"','"+rowwhere+"','"+cnt+"','1');",
			    "(state,"+colwhere+") AND ("+rowwhere+")",step
			)
		    );
		} else {
		    row.appendChild(
			state.Html.makeCanvasElement(state,
			    elements,
			    colkey,
			    colvalues.slice(state,jj,jj+step),
			    range,
			    "state.Layout.selectItem(state,'"+colkey+"','"+rowkey+"','"+colvalues[jj]+"','"+rowval+"','"+
				colwhere+"','"+rowwhere+"','"+cnt+"','1');",
			    "(state,"+colwhere+") AND ("+rowwhere+")",step)
		    );
		}
	    };
	}
    }
};
export default Table2D;
